import React from 'react'
import { createContext, useStat } from 'react'

export const EditAlarmContext = createContext({})

const EditingAlarmContextProvider = ({children}) => {
    const [editingAlarmData, setEditingAlarmData] = useState({})
    return (
        <EditAlarmContext.Provider value={{editingAlarmData, setEditingAlarmData}} >{children}</EditAlarmContext.Provider>
    )
}

export default EditingAlarmContextProvider
